import React from "react";

const Alert = (props) => {
  return (
    <div>
      <div className="alert alert-warning alert-dismissible fade show bg-success text-light" role="alert">
       { props.message}
        <button
          type="button"
          className="btn-close"
          data-bs-dismiss="alert"
          aria-label="Close"
        ></button>
      </div>
    </div>
  );
};

export default Alert;
